var gutil=require("gulp-util"),prettyHrtime=require("pretty-hrtime"),startTime;module.exports={start:function(e){startTime=process.hrtime(),gutil.log("Bundling",gutil.colors.green(e)+"...")},end:function(e){var t=process.hrtime(startTime),n=prettyHrtime(t);gutil.log("Bundled",gutil.colors.green(e),"in",gutil.colors.magenta(n))}};